description:
Chuyển sinh vui sướng tiểu thiên sứ, Toa Toa thức tỉnh rồi kỳ quái mị mị dương chi lực.

Thí luyện thế giới ta quyền đánh ác ma, kỵ sĩ thế giới ta thẩm phán sa đọa giáo hội;

Dị trùng thế giới ta kiến tạo nơi ẩn núp, áo thuật thế giới ta lật đổ hủ bại đế quốc;

Thiên sứ vì ta ca hát, ác ma đối ta cúi đầu;

Các ngươi cho rằng ta là tia nắng ban mai ánh sáng, thiên sứ chi vương?

Kỳ thật......

Ta là tiết dương dương đát!

___________

